import React from "react"
import { useState } from "react"

function CircleModal({circleModal}) {
    const [opacity, setOpacity] = useState(0);
    const [zIndex, setZIndex] = useState(-1);

    if(circleModal === false) {
        setOpacity(100)
        setZIndex(1)
    }

    return (
        <div id="circleModal" style={{opacity: `{opacity}`, zIndex: `{zIndex}`}}>
            Circle Modal
        </div>
    )
}

export default CircleModal;
